import {
  HideBetween,
  HideDuring,
  HideOn,
  HideScroll,
} from "react-hide-on-scroll";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useHistory,
  HashRouter
} from "react-router-dom";
import './App.css';

import ParticlesBg from "particles-bg";

import Header from "./Components/Header";
import Landing from "./Components/Landing"
import About from "./Components/About"
import Resume from "./Components/Resume"
import Portfolio from "./Components/Portfolio"
import SkillBar from "./Components/skill_bar/SkillBar"

function App() {
  return (
    <div className="App">


      <HideDuring inverse>
        <Header/>
      </HideDuring>
      <HideScroll variant="down" showOnPageInit={true}>
        <HideScroll variant="up">
          <Header/>
        </HideScroll>
      </HideScroll>
      <Landing/>
      <About/>
      <Resume/>
      <Portfolio/>

      <div style={{width: '100%', height: '900px', backgroundColor: 'blue'}}>
        <SkillBar skill = "Test" progress = '70' color="red"/>
      </div>

      <div style={{width:'100%', backgroundColor:'black'}}>
        <p style={{fontSize:'12px', color:'gray'}}>
          v1.1.4
        </p>
      </div>
    </div>
  );
}

export default App;
